import Header from './component/layout/Header';
import React, { Fragment } from 'react';
import Meals from "./component/meals/Meals";
import Cart from "./component/UI/Card";

function App() {
    return (
        <Fragment>
            <Cart />
            <Header />
            <main>
                <Meals />
            </main>
        </Fragment>
    );
}

export default App;
